import React, { useState, useEffect } from "react";

const Carousel = () => {
  const carouselItem = [
    {
      src: "data:image/jpeg;base64,",
      alt: "image1",
    },
    {
      src: "data:image/jpeg;base64,",
      alt: "image2",
    },
    {
      src: "data:image/jpeg;base64,",
      alt: "image3",
    },
  ];

  const [currentIndex, setCurrentIndex] = useState(0);

  useEffect(() => {
    setTimeout(() => {
      onNext();
    }, 3000);
  }, [currentIndex]);

  const onNext = () => {
    if (currentIndex == carouselItem.length - 1) return setCurrentIndex(0);
    setCurrentIndex(currentIndex + 1);
  };

  const onPrev = () => {
    if (currentIndex == 0) return setCurrentIndex(carouselItem.length - 1);
    setCurrentIndex(currentIndex - 1);
  };

  return (
    <>
      Carousel
      <div>
        <>
          {
            <img
              src={carouselItem[currentIndex].src}
              alt={carouselItem[currentIndex].alt}
            />
          }
        </>
      </div>
      <button onClick={onNext}> Next</button>
      <button onClick={onPrev}> Prev</button>
    </>
  );
};

export default Carousel;
